import React from 'react';
import { useSelector } from 'react-redux';
import './App.css';

function App() {
  const message = useSelector(state => state.message.messages);
  console.log(message);
  return (
    <div className="App">
      <h1>Random Greeting</h1>
      {message.map((mes)=> {
        return <p>{mes.name}</p>
      })}
    </div>
  );
}

export default App;
